import React from 'react';
import './App.css';
import { render } from '@testing-library/react';

class App extends React.Component {
  render() {
    return  React.createElement(
      'div', { className: "App"},
      React.createElement("h1", null, "Hello from React")
    );
  }
}

export default App;
